fn test_all_vectors() {
	for v in vectors {
		input := hex.decode(v.input)!
		key := hex.decode(v.key)!
		output := hex.decode(v.output)!

		mut d := if key.len == 0 {
			blake2b.new512() or {
				assert false, 'unable to create new 512 bit hash digest: ${err}'
				return
			}
		} else {
			blake2b.new_pmac512(key) or {
				assert false, 'unable to create new 512 bit pmac digest: ${err}'
				return
			}
		}

		d.write(input) or {
			assert false, 'unable to add input ${input}: ${err}'
			return
		}

		hash := d.checksum()

		assert hash == output, 'input: ${v.input} key: ${v.key}'
	}
}
